data["Humanitarian OpenStreetMap Team"]["Which Projects have the most contributors?"]={url_hash:"3c19",0: "The contributor count per project is determined by how many individual users (individual OSM user names) have used the project hashtag. The numbers seem to be <b>higher than the official numbers</b> of the project. I don't know why that's the case. If you have an idea feel free to open an <a href='https://github.com/piebro/openstreetmap-statistics/issues'>issue</a>.",data_path_1: "table_data/humanitarian_openstreetmap_team_yearly_contributor_count_per_project.json",update: async function(){await add_text("Humanitarian OpenStreetMap Team","Which Projects have the most contributors?","0");await add_table("Humanitarian OpenStreetMap Team","Which Projects have the most contributors?","1");},save_plot: function(){save_text("Humanitarian OpenStreetMap Team","Which Projects have the most contributors?","0");},save_data: function(){save_text_data("Humanitarian OpenStreetMap Team","Which Projects have the most contributors?","0");save_table_data("Humanitarian OpenStreetMap Team","Which Projects have the most contributors?","1");}};
data["Humanitarian OpenStreetMap Team"]["Which Projects have the most edits?"]={url_hash:"1e56",0: "The edit count per project is the sum of all edits that use the project hashtag. The number of edits is determined by how many nodes, ways or relations were created or changed. The number seems to be <b>higher than the official numbers</b> of the project. This could be, because the Humanitarian OSM Team uses another metric for counting edits. For example, they might count adding a build as only one edit.",data_path_1: "table_data/humanitarian_openstreetmap_team_yearly_edits_count_per_project.json",update: async function(){await add_text("Humanitarian OpenStreetMap Team","Which Projects have the most edits?","0");await add_table("Humanitarian OpenStreetMap Team","Which Projects have the most edits?","1");},save_plot: function(){save_text("Humanitarian OpenStreetMap Team","Which Projects have the most edits?","0");},save_data: function(){save_text_data("Humanitarian OpenStreetMap Team","Which Projects have the most edits?","0");save_table_data("Humanitarian OpenStreetMap Team","Which Projects have the most edits?","1");}};
